import React from 'react'

function SearchForm() {
  return (
    <div>
    <form className='ItemAdd d-flex' >
                <input type="text" className='form-control'  placeholder="neds"  />
                <button className='btn btn-outline-secondary'>Search</button>
            </form>
    </div>
  )
}

export default SearchForm
